import React, { Component } from 'react';
import { connect } from 'react-redux';
import { FormattedMessage } from 'react-intl';
import "./HomeFooter.scss";

class HomeFooter extends Component {

    render() {

        return (
            <div className='home-footer-container'>
                <div className='home-footer-content-left title-content'>
                    <div className='home-footer-title'>BaiAquatic
                        <hr></hr>
                    </div>
                    <div className='home-footer-content'></div>
                </div>
                <div className='home-footer-content-cennter title-content'>
                    <div className='home-footer-title'>Bản đồ
                        <hr></hr>
                    </div>
                    <div className='home-footer-content'>
                        <h3>CÔNG TY TNHH MTV ĐỨC TUẤN</h3>
                        <h3>Địa chỉ: Phước An, Lộc Tiến, Phú Lộc, T.T.Huế</h3>
                        <h3>Điện thoại: (012)3456789 - Hotline: 0123456789</h3>
                        <h3>Email: bai.aqua@gmail.com</h3>
                    </div>
                </div>
                <div className='home-footer-content-right title-content'>
                    <div className='home-footer-title'>Fanpage
                        <hr></hr>
                    </div>
                    <div className='home-footer-content'></div>
                </div>
            </div>
        );
    };

}

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn,
        language: state.app.language
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(HomeFooter);
